        <CustomerClass name={'Tim'} age={23} title={'IT'}/>

        {/* <a
          className="App-link"
          href=""
          target="_blank"
          rel="noopener noreferrer"
        >
          HOME
        </a> */}

        {/* <Link to="/home"></Link> */}
        </header>
      </div>
    );
  }
  
  export default Home;
